Function: Properties.doesPropertyExist()
Description: <p>Checks whether a given property exists in preferences.</p>
Parameters: Parameter Type Description <code>property</code> String A property to check
Details: <p><code>app.properties.doesPropertyExist(property)</code></p>
Example: <p>Check whether labels with indices 10 and 99 exist in preferences:</p> <pre><code>var property = 'BE.Prefs.LabelNames.10';
var exists = app.properties.doesPropertyExist(property);
alert('Property "' + property + '" exists: ' + exists.toString());

