Function: Properties.getProperty()
Description: <p>Returns a property value.</p>
Parameters: Parameter Type Description <code>property</code> String A property to get a value for
Details: <p><code>app.properties.getProperty(property)</code></p>
Example: <p>Get label name at a given index:</p> <pre><code>var labelIndex = 0;
