Function: Properties.setProperty()
Description: <p>Set property value.</p> <p>Note</p> <p>For any file paths to be used in Premiere Pro's preferences, a trailing path seperator is mandatory.</p>
Parameters: Parameter Type Description <code>property</code> String A property to create <code>value</code> Any A value for a property <code>persistent</code> Boolean Whether if should be persistent between sessions <code>createIfNotExist</code> Boolean Should create, if such property does not exist
Details: <p><code>app.properties.setProperty(property, value, persistent, createIfNotExist)</code></p>
Example: <p>Change label name:</p> <pre><code>var labelIndex = 0;
var property = 'BE.Prefs.LabelNamesX.' + labelIndex;

var newValue = 'Changed via Script';
var persistent = true;
var createIfNotExist = true;

if (app.properties.doesPropertyExist(property)) {
    if (app.properties.isPropertyReadOnly(property)) {
        alert('Could not rename property "' + property + '" because it is read-only.');
    } else {
        var oldValue = app.properties.getProperty(property);
        app.properties.setProperty(property, newValue, persistent, createIfNotExist);
        alert('Value changed from "' + oldValue + '" to "' + newValue + '"');
    }
} else {
    app.properties.setProperty(property, newValue, persistent, createIfNotExist);
    alert('Created new property "' + property + '" with value "' + newValue + '"');
}
</code></pre>

